import{_ as e,a}from"./chunks/pixhawk4_status_leds.BNrM6JGL.js";import{_ as r,c as d,a8 as i,o}from"./chunks/framework.BDnHobkS.js";const f=JSON.parse('{"title":"Значення LED індикаторів (Pixhawk Series)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/getting_started/led_meanings.md","filePath":"uk/getting_started/led_meanings.md"}'),s={name:"uk/getting_started/led_meanings.md"};function l(n,t,h,c,m,p){return o(),d("div",null,t[0]||(t[0]=[i('<h1 id="значення-led-індикаторів-pixhawk-series" tabindex="-1">Значення LED індикаторів (Pixhawk Series) <a class="header-anchor" href="#значення-led-індикаторів-pixhawk-series" aria-label="Permalink to &quot;Значення LED індикаторів (Pixhawk Series)&quot;">​</a></h1><p><a href="./../flight_controller/pixhawk_series.html">Pixhawk-series flight controllers</a> use LEDs to indicate the current status of the vehicle.</p><ul><li>The <a href="#ui_led">UI LED</a> provides user-facing status information related to <em>readiness for flight</em>.</li><li>The <a href="#status_led">Status LEDs</a> provide status for the PX4IO and FMU SoC. Вони показують заряд, режим і стан завантажувача, а також помилки.</li></ul><p><a id="ui_led"></a></p><h2 id="led-індикатори-інтерфеису" tabindex="-1">LED індикатори інтерфейсу <a class="header-anchor" href="#led-індикатори-інтерфеису" aria-label="Permalink to &quot;LED індикатори інтерфейсу&quot;">​</a></h2><p>The RGB <em>UI LED</em> indicates the current <em>readiness for flight</em> status of the vehicle. Зазвичай це дуже яскравий I2C, який може бути встановлений або не встановлений на платі політного контролера (наприклад. FMUv4 не має такого на борту, і зазвичай використовує світлодіод, встановлений на GPS).</p><p>На зображенні нижче показано взаємозв&#39;язок між світлодіодом і станом апарату.</p><div class="warning custom-block"><p class="custom-block-title">WARNING</p><p>It is possible to have a GPS lock (Green LED) and still not be able to arm the vehicle because PX4 has not yet <a href="./../flying/pre_flight_checks.html">passed preflight checks</a>. <strong>A valid global position estimate is required to takeoff!</strong></p></div><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>In the event of an error (blinking red), or if the vehicle can&#39;t achieve GPS lock (change from blue to green), check for more detailed status information in <em>QGroundControl</em> including calibration status, and errors messages reported by the <a href="./../flying/pre_flight_checks.html">Preflight Checks (Internal)</a>. Також перевірте, чи правильно підключений GPS-модуль, чи правильно Pixhawk зчитує ваш GPS, і чи правильно GPS передає дані про місцеперебування.</p></div><p><img src="'+e+'" alt="LED meanings"></p><ul><li><p><strong>[Solid Blue] Armed, No GPS Lock:</strong> Indicates vehicle has been armed and has no position lock from a GPS unit. Коли апарат вмикається, PX4 розблоковує керування моторами, що дозволить вам керувати дроном. Як завжди, будьте обережні під час увімкнення, оскільки великі гвинти можуть бути небезпечними на високих обертах. У цьому режимі апарат не може виконувати керовані місії.</p></li><li><p><strong>[Pulsing Blue] Disarmed, No GPS Lock:</strong> Similar to above, but your vehicle is disarmed. Це означає, що ви не зможете управляти моторами, але всі інші підсистеми працюють.</p></li><li><p><strong>[Solid Green] Armed, GPS Lock:</strong> Indicates vehicle has been armed and has a valid position lock from a GPS unit. Коли апарат вмикається, PX4 розблоковує керування моторами, що дозволить вам керувати дроном. Як завжди, будьте обережні під час увімкнення, оскільки великі гвинти можуть бути небезпечними на високих обертах. У цьому режимі апарат може виконувати керовані місії.</p></li><li><p><strong>[Pulsing Green] Disarmed, GPS Lock:</strong> Similar to above, but your vehicle is disarmed. Це означає, що ви не зможете управляти моторами, але всі інші підсистеми, включаючи GPS-фіксацію положення, працюють.</p></li><li><p><strong>[Solid Purple] Failsafe Mode:</strong> This mode will activate whenever vehicle encounters an issue during flight, such as losing manual control, a critically low battery, or an internal error. Під час аварійного режиму апарат намагатиметься повернутися до місця зльоту або може просто знизитися там, де він зараз перебуває.</p></li><li><p><strong>[Solid Amber] Low Battery Warning:</strong> Indicates your vehicle&#39;s battery is running dangerously low. Після певного моменту пристрій перейде у failsafe режим. Однак цей режим повинен сигналізувати про те, що настав час завершити політ.</p></li><li><p><strong>[Blinking Red] Error / Setup Required:</strong> Indicates that your autopilot needs to be configured or calibrated before flying. Під&#39;єднайте автопілот до наземної станції керування, щоб перевірити, в чому проблема. Якщо ви завершили процес налаштування, а автопілот все ще сигналізує червоним і блимає, можливо, виникла інша помилка.</p></li></ul><p><a id="status_led"></a></p><h2 id="індикатор-стану" tabindex="-1">Індикатор стану <a class="header-anchor" href="#індикатор-стану" aria-label="Permalink to &quot;Індикатор стану&quot;">​</a></h2><p>Three <em>Status LEDs</em> provide status for the FMU SoC, and three more provide status for the PX4IO (if present). Вони показують заряд, режим і стан завантажувача, а також помилки.</p><p><img src="'+a+'" alt="Pixhawk 4"></p><p>Після ввімкнення живлення процесори FMU та PX4IO спочатку запускають завантажувач (BL), а потім додаток (APP). У таблиці нижче показано, як завантажувач, а потім додаток використовують світлодіоди для індикації стану.</p><table tabindex="0"><thead><tr><th>Колір</th><th>Позначка</th><th>Використання завантажувача</th><th>Використання додатку</th></tr></thead><tbody><tr><td>Синій</td><td>ACT (активність)</td><td>Мерехтить, коли завантажувач отримує дані</td><td>Індикація стану ARM</td></tr><tr><td>Червоний/помаранчевий</td><td>B/E (в завантажувачі / помилка)</td><td>Мерехтить, коли в завантажувачі</td><td>Індикація ERROR</td></tr><tr><td>Зелений</td><td>PWR (потужність)</td><td>Не використовується в завантажувачі</td><td>Індикація стану ARM</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The LED labels shown above are commonly used, but might differ on some boards.</p></div><p>Більш детальна інформація про те, як інтерпретувати світлодіодні індикатори, наведені нижче (де &quot;х&quot; означає &quot;будь-який стан&quot;)</p><table tabindex="0"><thead><tr><th>Червоний/помаранчевий</th><th>Синій</th><th>Зелений</th><th>Значення</th></tr></thead><tbody><tr><td>10 Гц</td><td>x</td><td>x</td><td>Overload CPU load &gt; 80%, or RAM usage &gt; 98%</td></tr><tr><td>ВИМК</td><td>x</td><td>x</td><td>Overload CPU load &lt;= 80%, or RAM usage &lt;= 98%</td></tr><tr><td>NA</td><td>ВИМК</td><td>4 Гц</td><td>actuator_armed-&gt;armed &amp;&amp; failsafe</td></tr><tr><td>NA</td><td>УВІМК</td><td>4 Гц</td><td>actuator_armed-&gt;armed &amp;&amp; !failsafe</td></tr><tr><td>NA</td><td>ВИМК</td><td>1 Гц</td><td>!actuator_armed-&gt; armed &amp;&amp; actuator_armed-&gt;ready_to_arm</td></tr><tr><td>NA</td><td>ВИМК</td><td>10 Гц</td><td>!actuator_armed-&gt;armed &amp;&amp; !actuator_armed-&gt;ready_to_arm</td></tr></tbody></table>',20)]))}const b=r(s,[["render",l]]);export{f as __pageData,b as default};
